import React from 'react';
import logo from './logo.svg';
import './App.css';

const coworkers = 

class App extends React.Component {

  constructor(props) {
      super(props);
      this.state = {
        coworkers: [
          { name: "Pooja", role: "dev"},
          { name: "Junhui", role: "dev"},
          { name: "Raghav", role: "dev"},
          { name: "Navaneet", role: "dev"},
          { name: "Eric", role: "dev"},
          { name: "Josh", role: "dev"},
          { name: "Randy", role: "qa"},
          { name: "Asmi", role: "design"},
          { name: "Santosh", role: "manager"}
        ]
      };

      this.generateUsers = this.generateUsers.bind(this);
  }

  generateUsers() {
    return this.state.coworkers.map(person => {
      return (
      <>
        <div>{person.name} ({person.role})</div>
      </>
      )
    })
  }


  render() {
      return (
        <div className="App">
        <header className="App-header">
          {/* <img src={logo} className="App-logo" alt="logo" /> */}
          <p>
            Checkout Directory
          </p>
          <p>
            {this.generateUsers()}
          </p>
        </header>
      </div>
      );
  }
}

export default App;
